import { faEye, faEyeSlash, faEdit, faTrash } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import React, { useState, useEffect } from 'react';
import axios from '../commons/axios';
import { baseURL } from '../commons/helper';

const ManageAccountsTable = () => {
    const [applicationData, setApplicationData] = useState([]);
    const [showHKID, setShowHKID] = useState(false);

    useEffect(() => {
        fetchApplicationData();
    }, []);

    const fetchApplicationData = async () => {
        try {
            const response = await axios.get(`${baseURL}/get-employees-accounts`);
            setApplicationData(response.data);
        } catch (error) {
            console.error('Error fetching application data:', error);
        }
    };

    function maskHKID(hkid) {
        if (hkid.length >= 5) {
            const maskedHKID = `${hkid.substring(0, 5)}***`;
            return maskedHKID;
        }
        return hkid;
    }

    const handleUpdate = (applicationId) => {
        // Handle update logic here
        console.log('Update application with ID:', applicationId);
    };

    const handleEdit = (applicationId) => {
        // Handle edit logic here
        console.log('Edit application with ID:', applicationId);
    };

    const handleDelete = (applicationId) => {
        // Handle delete logic here
        console.log('Delete application with ID:', applicationId);
    };

    return (
        <div className='container'>
            <table className="table">
                <thead>
                    <tr>
                        <th>Employee ID</th>
                        <th>Full Name</th>
                        <th>Email</th>
                        <th>Date of Birth</th>
                        <th>Gender</th>
                        <th>Phone Number</th>
                        <th>Address</th>
                        <th>State</th>
                        <th>Position</th>
                        <th>Department</th>
                        <th>Employee ID</th>
                        <th>HK ID
                            <button className="icon is-small" onClick={() => setShowHKID(!showHKID)}>
                                <FontAwesomeIcon icon={showHKID ? faEye : faEyeSlash} />
                            </button>
                        </th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {applicationData.map((application) => (
                        <tr key={application.id}>
                            <td>{application.employeeID}</td>
                            <td>{application.fullName}</td>
                            <td>{application.email}</td>
                            <td>{application.dateOfBirth}</td>
                            <td>{application.gender}</td>
                            <td>{application.phoneNumber}</td>
                            <td>{application.address}</td>
                            <td>{application.state}</td>
                            <td>{application.position}</td>
                            <td>{application.department}</td>
                            <td>{application.employeeID}</td>
                            <td>
                                {showHKID ? (
                                    application.hkID
                                ) : (
                                    <span>{maskHKID(application.hkID)}</span>
                                )}
                            </td>
                            <td>
                                <button className="icon is-small" onClick={() => handleUpdate(application.id)}>
                                    <FontAwesomeIcon icon={faEdit} />
                                </button>
                                <button className="icon is-small" onClick={() => handleEdit(application.id)}>
                                    <FontAwesomeIcon icon={faTrash} />
                                </button>
                                <button className="icon is-small" onClick={() => handleDelete(application.id)}>
                                    <FontAwesomeIcon icon={faTrash} />
                                </button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default ManageAccountsTable;
